import * as React from "react";
import { Logo } from "./Logo";
import { NavItem } from "./NavItem";

const navItems = [
  { label: "Home", isHighlighted: false },
  { label: "Languages", isHighlighted: false },
  { label: "SUBJECTS", isHighlighted: false },
  { label: "about us", isHighlighted: false },
  { label: "contact us", isHighlighted: true }
];

export const Navbar: React.FC = () => {
  return (
    <nav className="fixed top-0 left-0 right-0 z-50">
      <div className="flex flex-wrap gap-10 font-black tracking-wider leading-7 text-gray-200 uppercase bg-neutral-900 rounded-[123px]" role="navigation" aria-label="Main navigation">
        <Logo
          imageUrl="https://cdn.builder.io/api/v1/image/assets/fa4132ae96b74be98ebea8ccbef58b81/f97096619879b9bb974b1d3321e3e5a9268b9b643dd7987cd5ce3bfec8fe55bf?apiKey=d7cd1c2741e34af9a21b86c09b36aa85&"
          title="CURIOUSOZZY"
        />
        <div
          className="flex flex-wrap gap-5 justify-center items-center self-start px-10 py-8 text-base text-center max-md:px-5"
          role="menu"
        >
          {navItems.map((item, index) => (
            <NavItem
              key={index}
              label={item.label}
              isHighlighted={item.isHighlighted}
            />
          ))}
        </div>
      </div>
    </nav>
  );
};
